function addUsersToNewFirestoreData(i) {

    db.collection("year").doc("2021").collection("classes").doc(classIdStrArr7[i]).collection("users").add({
        uid: uidStrArr7[i],
        name: nameStrArr7[i]
    })
    .then(() => {
        console.log("Document written with ID: ");
        
        if (i + 1 < classIdStrArr7.length) {
            addUsersToNewFirestoreData(i + 1);
        }
    })
    .catch((error) => {
        console.error("Error writing document: ", error);
    });

}








